// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC1155/ERC1155Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";

import "./Strings.sol";


/// @title ArtToken
contract ArtToken is ERC1155Upgradeable, OwnableUpgradeable {
    using SafeMathUpgradeable for uint256;
    using ERC1155Strings for string;

    event TokenCreated(uint256 tokenId, address creator, string uri);

    event MetadataFrozen(uint256 tokenId);

    uint256 private _currentTokenID = 0;
    mapping (uint256 => address) public creators;
    mapping (uint256 => uint256) public tokenSupply;
    mapping (uint256 => string) public uris;
    mapping (uint256 => bool) public isMetadataFrozen;

    // Contract name
    string public name;
    // Contract symbol
    string public symbol;

    /// @dev Require msg.sender to be the creator of the token id
    modifier creatorOnly(uint256 _id) {
        require(creators[_id] == msg.sender, "ArtToken#creatorOnly: ONLY_CREATOR_ALLOWED");
        _;
    }

    modifier operatorOnly(uint256 _id) {
        bool isCreator = creators[_id] == msg.sender;
        bool isOperator = isApprovedForAll(creators[_id], msg.sender);
        require(isCreator || isOperator, "ArtToken#operatorOnly: ONLY_OPERATOR_ALLOWED");
        _;
    }

    /// @dev Require msg.sender to own more than 0 of the token id
    modifier ownersOnly(uint256 _id) {
        require(balanceOf(msg.sender, _id) > 0, "ArtToken#ownersOnly: ONLY_OWNERS_ALLOWED");
        _;
    }

    constructor(string memory _name, string memory _symbol) ERC1155Upgradeable() {
        name = _name;
        symbol = _symbol;
    }

    function getTokenDetails(uint256 _id) public view returns(
        address, uint256, string memory, uint256, bool
    ) {
        return (
            address(this),
            _id,
            "ERC1155",
            getChainID(),
            isMetadataFrozen[_id]
        );
    }

    function uri(uint256 _id) public view override returns (string memory) {
        require(exists(_id), "ArtToken#uri: NONEXISTENT_TOKEN");
        return uris[_id];
    }

    /// @dev Returns the total quantity for a token ID
    /// @param _id uint256 ID of the token to query
    /// @return amount of token in existence
    function totalSupply(uint256 _id) public view returns (uint256) {
        return tokenSupply[_id];
    }

    /// @dev Creates a new token type and assigns _initialSupply to an address
    /// @param _initialOwner address of the first owner of the token
    /// @param _initialSupply amount to supply the first owner
    /// @param _uri Optional URI for this token type
    /// @param _data Data to pass if receiver is contract
    /// @return The newly created token ID
    function create(
        address _initialOwner,
        uint256 _initialSupply,
        string calldata _uri,
        bytes calldata _data
    ) external returns (uint256) {
        uint256 _id = _getNextTokenID();
        _incrementTokenTypeId();
        creators[_id] = msg.sender;

        if (bytes(_uri).length > 0) {
            uris[_id] = _uri;
            emit URI(_uri, _id);
        }

        isMetadataFrozen[_id] = false;

        emit TokenCreated(_id, msg.sender, _uri);

        if (_initialOwner != address(0) && _initialSupply != 0) {
            _mint(_initialOwner, _id, _initialSupply, _data);
            tokenSupply[_id] = _initialSupply;
        }
        return _id;
    }

    /// @dev Freeze NFT metadata (the metadata cannot be de-freeze later)
    /// @custom:ref https://support.opensea.io/hc/en-us/articles/1500012270982-What-is-Freezing-Metadata-
    /// @custom:ref https://soliditydeveloper.com/ipfs
    function freezeMetadata(uint256 _id) external {
        require(
            creators[_id] == msg.sender,
            "ArtToken.freezeMetadata# UNAUTHORIZED_ACCESS_TO_FREEZE_METADATA"
        );
        require(
            !isMetadataFrozen[_id],
            "ArtToken.freezeMetadata# CANNOT_FREEZE_FROZEN_METADATA"
        );
        isMetadataFrozen[_id] = true;
        emit MetadataFrozen(_id);
    }

    /// @dev Mints some amount of tokens to an address
    /// @param _to          Address of the future owner of the token
    /// @param _id          Token ID to mint
    /// @param _quantity    Amount of tokens to mint
    /// @param _data        Data to pass if receiver is contract
    function mint(
        address _to,
        uint256 _id,
        uint256 _quantity,
        bytes memory _data
    ) public operatorOnly(_id) {
        _mint(_to, _id, _quantity, _data);
        tokenSupply[_id] = tokenSupply[_id].add(_quantity);
    }

    /// @dev Mint tokens for each id in _ids
    /// @param _to          The address to mint tokens to
    /// @param _ids         Array of ids to mint
    /// @param _quantities  Array of amounts of tokens to mint per id
    /// @param _data        Data to pass if receiver is contract
    function batchMint(
        address _to,
        uint256[] memory _ids,
        uint256[] memory _quantities,
        bytes memory _data
    ) public {
        for (uint256 i = 0; i < _ids.length; i++) {
            uint256 _id = _ids[i];

            bool isCreator = creators[_id] == msg.sender;
            bool isOperator = isApprovedForAll(creators[_id], msg.sender);
            require(isCreator || isOperator, "ArtToken#operatorOnly: ONLY_OPERATOR_ALLOWED");

            uint256 quantity = _quantities[i];
            tokenSupply[_id] = tokenSupply[_id].add(quantity);
        }
        _mintBatch(_to, _ids, _quantities, _data);
    }

    /// @dev Change the creator address for given tokens
    /// @param _to   Address of the new creator
    /// @param _ids  Array of Token IDs to change creator
    function setCreator(address _to, uint256[] memory _ids) public {
        require(_to != address(0), "ArtToken#setCreator: INVALID_ADDRESS");
        for (uint256 i = 0; i < _ids.length; i++) {
            uint256 id = _ids[i];
            _setCreator(_to, id);
        }
    }

    /// @dev Change the creator address for given token
    /// @param _to   Address of the new creator
    /// @param _id  Token IDs to change creator of
    function _setCreator(address _to, uint256 _id) internal creatorOnly(_id) {
        creators[_id] = _to;
    }

    /// @dev Returns whether the specified token exists by checking to see if it has a creator
    /// @param _id uint256 ID of the token to query the existence of
    /// @return bool whether the token exists
    function exists(uint256 _id) public view returns (bool) {
        return creators[_id] != address(0);
    }

    /// @notice Returns the chain id of the current blockchain.
    /// @dev This is used to workaround an issue with ganache returning different values from the on-chain chainid() function and
    ///  the eth_chainId RPC method. See https://github.com/protocol/nft-website/issues/121 for context.
    function getChainID() public view returns (uint256) {
        uint256 id;
        assembly {
            id := chainid()
        }
        return id;
    }

    /// @dev calculates the next token ID based on value of _currentTokenID
    /// @return uint256 for the next token ID
    function _getNextTokenID() private view returns (uint256) {
        return _currentTokenID.add(1);
    }

    /// @dev increments the value of _currentTokenID
    function _incrementTokenTypeId() private  {
        _currentTokenID++;
    }
}

